    // about.html
    "about_title": "About",
    "about_h1": "About the Test",
    "about_h2_1": "Why was this test created?",
    "about_h3_1": "There is a certain pattern to your love life",
    "about_p_1": "Everyone has clear differences in how they start a relationship, the speed at which they build emotions, and their attitude toward maintaining a relationship. This test was not created to judge 'who is right or wrong,' but to find out what choices you have been repeating in your relationships. The purpose of this test is to help you organize your love habits and emotional direction, which you couldn't explain clearly on your own, into words.",
    "about_h3_2": "Simple but intuitive love style analysis",
    "about_p_2": "Instead of complex psychological terms, this test is based on choices you often encounter in real-life dating situations. Therefore, the results are not theoretical but rather aim for a direction where you nod your head and think, 'Ah, I'm like this.' Feel free to read it and use it as a light reference guide for your love style.",
    "about_h2_2": "How are love styles divided?",
    "about_h3_3": "A test that looks at the criteria for choices in a relationship",
    "about_p_3": "This test is based on four criteria that repeatedly appear during a relationship. It looks at whether you value relationship stability or stimulation more, how you express your emotions, and where your attitude toward people and relationships is closer to. In other words, it is a test to find out, 'What kind of person am I who moves based on what criteria when I'm in a relationship?'",
    "about_h3_4": "It looks at 'love style,' not personality",
    "about_p_4": "This test is not intended to define your entire personality. This is because the same person can show completely different sides in friendships, family relationships, and romantic relationships. This test focuses only on the choices and attitudes revealed in dating situations.",
    "about_h2_3": "Results, this is how you see them accurately",
    "about_h3_5": "Love personality divided into four axes",
    "about_p_5": "The results are a combination of a total of four criteria. Each criterion means the direction you chose more often between two opposing choices. These four are combined to create a single love style code.",
    "about_h3_6": "The result code means 'the predominance of the ratio'",
    "about_p_6": "There are no right or wrong answers in each part. It's just that the side with more choices is displayed as your current love personality. Therefore, it is most appropriate to understand the results not as an absolute personality definition, but as a summary of trends so far.",
    "about_h3_7": "Results that can change, me that can be different",
    "about_p_7": "The results can change depending on your dating experience, age, and environment. Just as you in the past and you now make different choices, this test result is not a fixed destiny. Please use this result as a reference to understand 'me now.'",
    "about_h2_4": "What this test doesn't tell you",
    "about_h3_8": "It's impossible to explain everyone perfectly",
    "about_p_8": "No matter how many questions there are, a single test cannot explain a person's entire love life. This is because real-life dating continues to change depending on the situation, the other person, and emotions. This test is just one perspective that simplifies a complex reality.",
    "about_h3_9": "Don't lock yourself in the results",
    "about_p_9": "You may not like the results, or you may feel that they are different from your actual self. In that case, it is better to accept it as 'I'm making this choice less now' rather than 'this result is wrong.' This test exists not to define you, but to give you an opportunity to think.",
    "about_h3_10": "The answer to love is always between people",
    "about_p_10": "No matter how well-made the type description is, it cannot replace conversation and understanding in a real relationship. It is most ideal to use this test as a starting point for starting or looking back on a relationship. In the end, what's most important is how you build a relationship with the other person, rather than the results.",
    "about_back_button": "To Main Page",

    // contact.html
    "contact_title": "Contact",
    "contact_h1": "Contact",
    "contact_p_1": "If you have any questions or opinions about this love style personality test, please contact us at the email address below. Your valuable opinions will be of great help in improving our service.",
    "contact_h2_1": "How to Contact Us",
