    "contact_p_2": "Please leave your contact information with your inquiry, and we will reply as soon as possible after confirmation.",
    "contact_h2_2": "Report Illegal/Harmful Content",
    "contact_p_3": "If you find any illegal or harmful content in the test, please report it to the email address above, and we will take prompt action.",
    "contact_back_button": "To Test",

    // privacy.html
    "privacy_title": "Privacy Policy",
    "privacy_h1": "Privacy Policy",
    "privacy_p_1": "This Privacy Policy explains how the Love Style Personality Test (hereinafter 'the Service') collects, uses, stores, and protects your personal information.",
    "privacy_h2_1": "1. Personal Information We Collect",
    "privacy_p_2": "This service conducts tests without a separate membership registration process, and **does not collect or store any personally identifiable information, including test results and answers.**",
    "privacy_p_3": "However, the following information may be automatically generated and collected during the service use process.",
    "privacy_li_1": "**IP address, cookies, service usage records, access logs:** This is used only for the purpose of smooth service operation, access statistics analysis, and service improvement. This information is collected in a form that cannot identify individuals and is destroyed after a certain period of time.",
    "privacy_h2_2": "2. Purpose of Collection and Use of Personal Information",
    "privacy_li_2": "Calculation and provision of test results",
    "privacy_li_3": "Improving the service use environment and analyzing access statistics",
    "privacy_li_4": "Preventing fraudulent use and stabilizing service operation",
    "privacy_h2_3": "3. Period of Retention and Use of Personal Information",
    "privacy_p_4": "The collected non-personally identifiable information (IP address, service usage records, etc.) is used only for the purpose of service improvement and statistical analysis, and is **destroyed after being stored for a maximum of 6 months**. As a rule, we do not collect personally identifiable information.",
    "privacy_h2_4": "4. Procedure and Method of Destruction of Personal Information",
    "privacy_p_5": "Since this service does not collect personally identifiable information, a separate destruction procedure is not required. Non-personally identifiable information is destroyed in an irreparable manner after achieving its purpose.",
    "privacy_h2_5": "5. Chief Privacy Officer",
    "privacy_p_6": "Since this service does not receive separate membership registration and does not collect personally identifiable information, we do not have a Chief Privacy Officer.",
    "privacy_h2_6": "6. Changes to the Privacy Policy",
    "privacy_p_7": "This Privacy Policy may be changed if there are additions, deletions, or corrections to the contents in accordance with laws and policies.",
    "privacy_back_button": "To Test",

