    "result_ospb_title": "ğŸ¡ The Affectionate Realist Love Type",
    "result_ospb_summary": "A realistic and devoted type who is honest in expressing emotions, builds a stable relationship in a planned way, and moves with the partner at the center. A type that builds a solid foundation for a long-term relationship.",
    "result_ospb_description": "Consistently shows love through words and actions, and naturally takes care of future plans or anniversaries. Places the partner as an important axis of life and designs daily life together.",
    "result_ospb_pros": ["Gives the partner a strong sense of trust and stability.", "The partner constantly feels loved.", "Excellent ability to maintain a long-term relationship."],
    "result_ospb_cons": ["The partner may feel burdened as devotion becomes excessive.", "If the partner's reaction is lukewarm, resentment can easily build up.", "Can get burned out from too much self-sacrifice."],
    "result_ospb_advice": "Have theä½™è£• to respect your partner's pace and independence. Don't try to take care of everything perfectly and accept the natural flow. Practice sharing your own emotions honestly.",
    
    "result_ospi_title": "ğŸ§˜ The Devoted but Balanced Love Type",
    "result_ospi_summary": "A mature type who pursues honest emotional expression and a sense of stability while not losing personal space and balance. A realist suitable for a healthy long-term relationship.",
    "result_ospi_description": "Expresses sincere affection but does not hold on to all the time. Maintains a stable exchange while respecting each other's routines. Maintains a natural distance so that the relationship does not become heavy.",
    "result_ospi_pros": ["Emotional communication is smooth and there are few conflicts.", "The relationship is maintained healthily by respecting each other's freedom.", "It is stable in the long run because there is little emotional consumption."],
    "result_ospi_cons": ["The partner may feel that they are 'too calm or less interested.'", "Misunderstandings arise when the intensity of emotions seems weak.", "Initial satisfaction may seem low due to slow deep immersion."],
    "result_ospi_advice": "Intentionally increase the intensity of emotional expression when needed. Make it a habit to check the love signals your partner wants in advance. A balanced distance can be an even greater charm.",

