    "result_osfb_pros": ["The fun and excitement of the relationship are very great.", "Gives the partner a strong feeling of being special and precious.", "Injects vitality into the relationship with passionate energy."],
    "result_osfb_cons": ["When the excitement subsides, they become very anxious that the love has cooled.", "The relationship becomes a roller coaster due to severe mood swings.", "It is easy to get tired from excessive immersion."],
    "result_osfb_advice": "Learn the importance of stability and daily life as much as excitement. Make it a habit to talk about the highs and lows of your emotions with your partner. A small routine can lead to a deeper love.",
    
